import React, { Component } from "react";
import logo from "./logo.svg";
import "./App.css";

class App extends Component {
  constructor() {
    super();
    monsters = [
      {
        name: Chinhuau,
        id: mon1,
      },
      {
        name: knijcijo,
        id: mon2,
      },
      {
        name: Chinkpplh,
        id: mon2,
      }
    ];
  }

}
export default App;
